import MainPage from "./MainPage";
import "./App.css";
import store from "./store/store";
import { Provider } from "react-redux";
import Header from "./Header";
import { useState } from "react";
var App = () => {
  var [loading, setLoading] = useState(true);
  setTimeout(() => {}, 3000);
  return (
    <Provider store={store}>
      <Header />
      <MainPage />
    </Provider>
  );
};
export default App;
